      print("=====================================");

      // Estrutura de repeticao
      while (i < 11) {
        if (resp == 1) {
          print("# $n + $i = " + (n + i).toStringAsFixed(2));
        } else if (resp == 2) {
          print("# $n - $i = " + (n - i).toStringAsFixed(2));
        } else if (resp == 3) {
          print("# $n / $i = " + (n / i).toStringAsFixed(2));
        } else if (resp == 4) {
          print("# $n * $i = " + (n * i).toStringAsFixed(2));
        }

        // Incremento
        i++;
      }
      print("=====================================");
      i = 1;
    }
  }
}

